import React from 'react';

function Mennoblesse() {
	return (
		<div className="page">
			<h1>Mennoblesse</h1>
			<div className="content">
				<h2>프로젝트 소개</h2>
				<p>Mennoblesse는 럭셔리 패션 브랜드 디자인 프로젝트입니다.</p>

				<h3>주요 작업 내용</h3>
				<ul>
					<li>럭셔리 브랜드 아이덴티티</li>
					<li>패션 컬렉션 디자인</li>
					<li>매장 디스플레이 디자인</li>
					<li>브랜드 마케팅 캠페인</li>
				</ul>

				<h3>사용 기술</h3>
				<p>Adobe Creative Suite, 3D Modeling, Fashion Design Software</p>
			</div>
		</div>
	);
}

export default Mennoblesse;
